import React from 'react'

function Form({ article }) {
  return (
    <div>
        {article ? (
            <div>
                <label>Tittle</label>
                <input type="text" className='form-control' placeholder='Titulo'/>
                <label>Descricao</label>
                <textarea type="text" className='form-control' placeholder='Titulo'/>
            </div>
        ): null}
    </div>
  )
}

export default Form
